const AboutBox = () => {
    return (
        <div className="home-boxes">
        <div className="card" style={{ width: '18rem' }}>
            <div className="card-body">
                <h5 className="card-title" style={{textAlign: 'center'}}>About Me</h5>
                <p className="card-text">Hi, I am Crina Gurev and I am a passionate developer. I created this website to help students better study. To contact me you can add me on Linkedln or email me: </p>
            </div>
        </div>
            <div className="card" style={{ width: '18rem' }}>
                <div className="card-body">
                    <h5 className="card-title" style={{textAlign: 'center'}}>Welcome to MyStudyBot!</h5>
                    <p className="card-text">Hi, I am Crina Gurev and I am a passionate developer. I created this website to help students better study. To contact me you can add me on Linkedln or email me: </p>
                </div>
            </div>
        </div>

    );
};

export default AboutBox;
